import './App.css';
import Header from './components/Header';
import Home from './components/Home';
import SortingCodeImages from './components/SortingCodeImages';

function App() {
  return (
    <div className="App">
      <div className="container">
        <div className="container1">
          <Header />
          <Home />
        </div>
        <div className="container2">
          <SortingCodeImages/>
        </div>
      </div>
    </div>
  );
}
export default App;
